button.onclick:
///$debug
// sauvegarder au préalable les valeurs des champs
pushEventFieldsDataInTable();

backupView("Mission");

// branchement sur creation evenement
meibo.switchToCreateView("Event",null,0);

///$debug
var /*Table*/table = meibo.getField("EVENTS_TABLE");
var selectedRowIndex= getSelectedRowIndex();

if(selectedRowIndex>=0){
  // retirer l'élement du tableau EVENTS_TABLE et de la liste ATTENDEES_TCT_ID

  var /*String*/ selectedEventId = table.getRowObject(selectedRowIndex);
  table.deleteRow(selectedRowIndex);
  var /*Edit*/ attendeesField =  meibo.getField("ATTENDEES_TCT_ID");
  var /*Array*/ values = attendeesField.getContents();
  var /*Array*/ newValues = new Array(values.length-1);

  meibo.setFieldValue("ROW_INDEX","-1");

  if(values.length > 1){
    var /*int*/ i =0;
    for each(var value in values){
      if(value != selectedEventId){
        newValues[i] = value;
        i++;
      }
    }
    showEventFieldsForRow(0);
  }else{
    meibo.showField("REMOVE_BTN", false);    
    meibo.getField("PARTICIPATION_BLOC").show(false);
  }
  attendeesField.setContents(newValues);

  //meibo.getField("REMOVE_BTN").setEnabled(false);  
}
